function getDisputeLookup(isEncryptResponse, encryptionPassword) {
    
    var userName = MFP.Server.getPropertyValue("wsse.tibco.username");
    var password = MFP.Server.getPropertyValue("wsse.tibco.password");

    var requestDate = new Date(Date.now());
    var requestDateFormated = requestDate.toISOString(); // Returns 2011-10-05T14:48:00.000Z

    var request = '<soapenv:Envelope xmlns:sch="http://www.rta.ae/schemas/SalikLookupService/Schema.xsd" xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/">'+
                  '<soapenv:Header>'+
                  '<wsse:Security soapenv:mustUnderstand="1" xmlns:wsse="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd" xmlns:wsu="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-utility-1.0.xsd">'+
                  '<wsse:UsernameToken wsu:Id="UsernameToken-10">'+
                  '<wsse:Username>' + userName + '</wsse:Username>'+
                  '<wsse:Password Type="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-username-token-profile-1.0#PasswordText">' + password + '</wsse:Password>'+
                  '<wsse:Nonce EncodingType="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-soap-message-security-1.0#Base64Binary">SSRsy9V6/42G0Oz7S5Bg5g==</wsse:Nonce>'+
                  '<wsu:Created>'+ requestDateFormated +'</wsu:Created>'+
                  '</wsse:UsernameToken>'+
                  '</wsse:Security>'+
                  '</soapenv:Header>'+
                  '<soapenv:Body>'+
                  '<sch:DisputeLookup>'+
                  '<sch:AppId>SALIK</sch:AppId>'+
                  '</sch:DisputeLookup>'+
                  '</soapenv:Body>'+
                  '</soapenv:Envelope>';
        
    var SOAPAction = "DisputeLookup";
    var servicePath = '/salikLookupService';
    var requestObj = buildBody([request.toString()], true);

    //return{
    //    message:request
    //}

    
    return invokeWebServiceString(requestObj, servicePath, SOAPAction, isEncryptResponse, encryptionPassword);
}






function Log(text) {
    
    MFP.Logger.warn(text);

    
    try {
        IsDebugging = MFP.Server.getPropertyValue("drivers_and_vehicles_is_debugging");
    } catch (e) {
        IsDebugging = "false";
    }
    if (IsDebugging == "true")
        MFP.Logger.warn(text);
    else
        MFP.Logger.debug(text);
}

function buildBody(parameters1, isStatic) {
    var request = "";
 MFP.Logger.info(" buildBody "+parameters1+" isStatic "+ isStatic);

 MFP.Logger.info(" After Trimming: "+parameters1+" isStatic "+ isStatic);
    if (isStatic == true) {
        MFP.Logger.info(" buildBody "+isStatic);
        request = MFP.Server.invokeProcedure({
            adapter : 'drivers_and_vehciles_utilitiesAdapter',
            procedure : 'buildBodyFromStaticRequest',
            parameters : parameters1

        });
    } else {
        request = MFP.Server.invokeProcedure({
            adapter : 'drivers_and_vehciles_utilitiesAdapter',
            procedure : 'buildBody',
            parameters : parameters1
        });
    }

    return request.body;
}

